interface IScoreProps{
    currentScore:number;
}
export const Score: React.FunctionComponent<IScoreProps> = React.memo((props) => {
    console.log("Score rendering: " ,props.currentScore);
    return <h2>Score: {props.currentScore}</h2>
});
